import React, { useEffect } from 'react'
import jwt from 'jsonwebtoken'

function Dashboard() {
    useEffect(()=>{
        const token = localStorage.getItem('token')
        if(token){
            const user = jwt.decode(token)
            console.log(user);
        }
    })
  return (
    <div>Dashboard</div>
  )
}

export default Dashboard
